import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonImg, IonButtons, IonMenuButton, IonItem } from '@ionic/react';

function Home() {
  return (
    <IonPage>
        {/* <IonHeader>
          <IonToolbar color='dark'>
              <IonButtons slot='start'>
                  <IonMenuButton></IonMenuButton>
              </IonButtons>
            <IonTitle>Home</IonTitle>
          </IonToolbar>
        </IonHeader> */}

        <IonHeader>
          <IonToolbar color='dark'>
            <IonButtons slot='start'>
                <IonMenuButton autoHide={false} menu='first'></IonMenuButton>
            </IonButtons>
            <IonTitle>
              <IonItem button href='/home' color='dark'>Umperium Image</IonItem>
            </IonTitle>
          </IonToolbar>
        </IonHeader>

        <IonContent class='padding-start'>
            The world is your oyster.
            <p>If you get lost, the <a target="_blank" rel="noopener" href="https://reactjs.org">docs</a> will be your guide</p>
        </IonContent>
    </IonPage>
  );
};

export default Home;
